import React, { useState, useEffect } from 'react';

const FeedbackDetailsPage = ({ id }) => {
  const [feedback, setFeedback] = useState(null);
  const [ratings, setRatings] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const [feedbackResponse, ratingsResponse] = await Promise.all([
          fetch('http://localhost:3000/feedback'),
          fetch('http://localhost:3000/ratings')
        ]);

        if (!feedbackResponse.ok) throw new Error('Failed to fetch feedback');
        if (!ratingsResponse.ok) throw new Error('Failed to fetch ratings');

        const feedbackData = await feedbackResponse.json();
        const ratingsData = await ratingsResponse.json();

        console.log('Feedback Response:', feedbackData);
        console.log('Ratings Response:', ratingsData);

        setFeedback(feedbackData);
        setRatings(ratingsData);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [id]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;
  if (!feedback || !ratings) return <div>No feedback or ratings found</div>;

  return (
    <div>
      <h1>Feedback Details</h1>
      <table>
        <tbody>
          <tr>
            <td>Institution Name:</td>
            <td>{feedback.institutionName}</td>
          </tr>
          <tr>
            <td>Website:</td>
            <td>{feedback.website}</td>
          </tr>
          <tr>
            <td>Visit Date:</td>
            <td>{new Date(feedback.visitDate).toLocaleDateString()}</td>
          </tr>
          <tr>
            <td>Staff Name:</td>
            <td>{feedback.staffName}</td>
          </tr>
          <tr>
            <td>Staff Email:</td>
            <td>{feedback.staffEmail}</td>
          </tr>
          <tr>
            <td>Staff Mobile:</td>
            <td>{feedback.staffMobile}</td>
          </tr>
          <tr>
            <td>Total Students:</td>
            <td>{feedback.totalStudents}</td>
          </tr>
          <tr>
            <td>Accompanying Staff:</td>
            <td>{feedback.accompanyingStaff}</td>
          </tr>
        </tbody>
      </table>

      <h2>Ratings</h2>
      <table>
        <tbody>
          <tr>
            <td>IPR Rating:</td>
            <td>{ratings.iprRating || 'N/A'}</td>
          </tr>
          <tr>
            <td>FCIPT Rating:</td>
            <td>{ratings.fciptRating || 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge:</td>
            <td>{ratings.knowledge || 'N/A'}</td>
          </tr>
          <tr>
            <td>Explanations IPR:</td>
            <td>{ratings.explanationsIPR || 'N/A'}</td>
          </tr>
          <tr>
            <td>Explanations FCIPT:</td>
            <td>{ratings.explanationsFCIPT || 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge Before:</td>
            <td>{ratings.knowledgeBefore || 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge After:</td>
            <td>{ratings.knowledgeAfter || 'N/A'}</td>
          </tr>
          <tr>
            <td>Technical Contents:</td>
            <td>{ratings.technicalContents || 'N/A'}</td>
          </tr>
          <tr>
            <td>Ease of Understanding:</td>
            <td>{ratings.easeOfUnderstanding || 'N/A'}</td>
          </tr>
        </tbody>
      </table>

      <h2>Additional Information</h2>
      <p>Sources: {feedback.sources?.join(', ') || 'N/A'}</p>
      <p>Campuses: {feedback.campuses?.join(', ') || 'N/A'}</p>
      <p>Best: {feedback.best || 'N/A'}</p>
      <p>Worst: {feedback.worst || 'N/A'}</p>
      <p>Suggestions: {feedback.suggestions || 'N/A'}</p>
      <p>Comments: {feedback.comments || 'N/A'}</p>

      <p>Created At: {new Date(feedback.createdAt).toLocaleString()}</p>
      <p>Updated At: {new Date(feedback.updatedAt).toLocaleString()}</p>
    </div>
  );
};

export default FeedbackDetailsPage;
